// Post.js
import React from 'react';

const Post = ({ post }) => {
  return (
    <div>
      <h2>{post.title}</h2>
      <p>{post.body}</p>
      {/* You can also add a link here to navigate to PostDetails */}
    </div>
  );
};

export default Post;
